import React from "react";
import { View, SafeAreaView, FlatList } from "react-native";
import { Title, Paragraph, Card, Avatar } from 'react-native-paper';
import styled from "styled-components/native";
import { mdiBike } from '@mdi/js';

const LeftContent = props => <Avatar.Icon {...props} icon={mdiBike} />

export const Layout = ({activities}) => (
    <SafeAreaView>
        <Title> Activities </Title>
        { activities.length === 0 ? 
            <Paragraph> There are no activities for this city </Paragraph>
            :
            <FlatList
                data={activities}
                renderItem={ ({ item }) => 
                    // <View style={{flex: 1, flexDirection: 'row'}}>
                    //     <Item>{item.title}</Item>
                    //     <Item>{item.price} U$S</Item>
                    // </View>
                    <View>
                        <Card style={{marginVertical: 10}}>
                            <Card.Title title={item.title} left={LeftContent} subtitle={item.price + " U$S"} />
                        </Card>
                    </View>
                }
                keyExtractor={item => item.id}
            />
        }
    </SafeAreaView>
);

const Item = styled.Text`
    background-color: rgb(25, 118, 210);
    padding: 10px;
    margin: 5px;
    color: white;
`
